import React, { useState } from 'react';
import '../src/SubmissionList.css';

const handleSubmit = (e) => {
  e.preventDefault();

  // Validation
  if (!fullName || !email || !dob || !agreeMarketing || !wantDemo) {
    console.error('Please fill in all fields');
    return;
  }

  const dobDate = new Date(dob);
  const today = new Date();
  const minDobDate = new Date(today.getFullYear() - 16, today.getMonth(), today.getDate());

  if (dobDate > minDobDate) {
    console.error('Date of birth must be at least 16 years ago');
    return;
  }

  const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
  if (!emailRegex.test(email)) {
    console.error('Invalid email address');
    return;
  }

  // Data object with form fields
  const data = {
    prospect: {
      full_name: fullName,
      email,
      date_of_birth: dob,
      subject_area: areaOfInterest,
      marketing_updates: agreeMarketing,
      correspondence_in_welsh: false, // Assuming this is always false for this scenario
      gps_location: "456.789,012.345" // You may need to replace this with actual GPS coordinates
    }
  };

  fetch('http://localhost:3000/prospects', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(data)
  })
  .then(response => {
    if (response.ok) {
      console.log('User data sent successfully');
      // Reset the form after successful submission
      setFullName('');
      setEmail('');
      setDob('');
      setAgreeMarketing(false);
      setWantDemo(false);
      setAreaOfInterest('developer');
    } else {
      console.error('Failed to send user data');
    }
  })
  .catch(error => {
    console.error('Error sending user data:', error);
  });
};


const SubmissionList = () => {
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setDob] = useState('');
  const [agreeMarketing, setAgreeMarketing] = useState(false);
  const [wantDemo, setWantDemo] = useState(false);
  const [areaOfInterest, setAreaOfInterest] = useState('developer');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create a data object with the form fields
    const data = {
      fullName,
      email,
      dob,
      agreeMarketing,
      wantDemo,
      areaOfInterest
    };

    fetch('https://your-api-endpoint.com', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    })
    .then(response => {
      if (response.ok) {
        console.log('User data sent successfully');
        // Reset the form after successful submission
        setFullName('');
        setEmail('');
        setDob('');
        setAgreeMarketing(false);
        setWantDemo(false);
        setAreaOfInterest('developer');
      } else {
        console.error('Failed to send user data');
      }
    })
    .catch(error => {
      console.error('Error sending user data:', error);
    });
  };


  return (
    <div className="user-registration-form">
      <h2>User Registration Form</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Full Name:
          <input
            type="text"
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
          />
        </label>
        <br />
        <label>
          Email:
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </label>
        <br />
        <label>
          Date of Birth:
          <input
            type="date"
            value={dob}
            onChange={(e) => setDob(e.target.value)}
          />
        </label>
        <br />
        <label>
          Area of Interest:
          <select value={areaOfInterest} onChange={(e) => setAreaOfInterest(e.target.value)}>
            <option value="developer">Developer</option>
            <option value="admin">Admin</option>
            <option value="ops">Ops</option>
          </select>
        </label>
        <br />
        <label>
          <input
            type="checkbox"
            checked={agreeMarketing}
            onChange={(e) => setAgreeMarketing(e.target.checked)}
          />
          Do you agree to receive marketing updates?
        </label>
        <br />
        <label>
          <input
            type="checkbox"
            checked={wantDemo}
            onChange={(e) => setWantDemo(e.target.checked)}
          />
          Do you want a demo?
        </label>
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default SubmissionList;
